@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .

:AuthorizationDialog a owl:Class .

:User a owl:Class ;
    rdfs:subClassOf :Customer .

:Password a owl:Class .

:enter a owl:ObjectProperty ;
    rdfs:domain :User ;
    rdfs:range :Password .

:requestedTo a owl:ObjectProperty ;
    rdfs:domain :AuthorizationDialog ;
    rdfs:range :User .
